import '../actions/actions';

const initialState = {};

const booksReducer = (state = initialState, action) => {
  switch (action.type) {
    case "SET_BOOKS":
      return { ...state, books: action.payload };
    case "SET_QUERY":
      return action.payload;
    default:
      return state;
  }
};

export default booksReducer;
